import { NavLink } from "react-router-dom";
import React from "react";
import './Nav.css';
import { Nav, NavDropdown, Navbar, Container, Badge } from "react-bootstrap";
class Navigation extends React.Component {
    constructor() {
        super();
    }

    NavLinkSignUp() {
        if (true) {
            return (
                <NavDropdown.Item as={NavLink} to="/signup">SignUp</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    NavLinkSignIn() {
        if (true) {
            return (
                <NavDropdown.Item as={NavLink} to="/signin">SignIn</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    render() {
        return (
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand>Care Center</Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="ml-auto">
                            <Nav.Link as={NavLink} to="/">Home</Nav.Link>
                            <NavDropdown title="Doctors" id="collasible-nav-dropdown">
                                <NavDropdown.Item as={NavLink} to="/doctor">Doctors Not Appointment</NavDropdown.Item>
                                <NavDropdown.Item as={NavLink} to="#action/3.2">Doctors Appointment</NavDropdown.Item>
                            </NavDropdown>
                            <NavDropdown title="Setting" id="collasible-nav-dropdown">
                                {this.NavLinkSignUp()}
                                {this.NavLinkSignIn()}
                                <NavDropdown.Item as={NavLink} to="#action/3.3">LogOut</NavDropdown.Item>
                                <NavDropdown.Item as={NavLink} to="#action/3.3">Profile</NavDropdown.Item>
                            </NavDropdown>
                            <Nav.Link as={NavLink} to="/contact">Contact Us</Nav.Link>
                            <Badge className="Badge" bg="primary">Ahmed<Badge className="Badgepill" pill bg="success">.</Badge></Badge>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        );
    }
}
export default Navigation;
